works.description:
参与跨境并购项目中的经营者集中中国反垄断申报以及配合进行其他司法辖区的反垄断申
报。参与项目主要涉及行业包括:电力、石油化工、半导体、制造业、房地产、汽车业、运
输业等。
? 对中国和其他国家(主要包括欧盟、美国和亚洲国家)的反垄断、外商投资审查、国家安全
审查和贸易反补贴法规及其执法动态(包括诉讼和行政处罚)进行研究,并参与为客户的境
外投资项目提供合规建议及项目风险评估。
? 参与市场监管总局不定期向各律师事务所征求对于反垄断相关法规或指引草案的意见或建议
的起草。
? 参与投融资/并购相关法律事务,包括对跨境交易中的目标公司进行尽职调查,公司ESOP设
立等。
参与项目:
反垄断:
- 参与阿联酋一家投资公司收购阿联酋一家国际知名石油公司股权项目的经营者集中申报;
- 参与欧洲两家公司收购欧洲沿海地区某一海上风电资产的经营者集中申报;
- 参与欧洲两家粮食贸易公司并购项目的经营者集中申报;
- 参与欧洲两家化学公司在境外设立合营企业的经营者集中申报;
- 参与一家日本运输公司收购一家澳大利亚物流公司股权项目的经营者集中申报;
- 参与一家国内半导体公司和半导体合资企业设立合营企业的经营者集中申报;
- 参与为客户提供欧洲反补贴制度方面的合规建议;
- 参与为国内一家大型互联网公司提供中国电商直播业和网络零售平台竞争状况及合规风险评
估项目。
公司投融资/并购:
- 参与一家日本贸易公司收购一家西班牙在华调味品制造子公司股权项目,主要负责尽职调查
部分;
- 参与一家公司的ESOP设立项目,主要负责员工期权协议和跟投权协议;
- 参与一家新能源材料制造公司的并购项目,并提供前期相关行业分析和公司信息检索。
- 参与一家制造业公司的海外股权转让项目,提供项目在美国国家安全审查方面的风险评估。
